$_MODULE['<{prestaspeed}prestashop>prestaspeed_25645c0e22ab8cbaadaa2bebc8cae772'] = 'قم بتنظيف هذا الخيار كافة إحصائيات للصور في قاعدة البيانات. إذا قمت بضغط الصور مرة أخرى، تحتاج إلى الانتظار مزيدا من الوقت معالجة كافة مرة أخرى. تنظيف جميع إذا كنت فقط قد إعادة إنشاء الصور الخاصة بك.';
$_MODULE['<{prestaspeed}prestashop>prestaspeed_8378867a3ab677d17334d832612b5cee'] = 'تحسين الصور الجديدة:';
$_MODULE['<{prestaspeed}prestashop>prestaspeed_a0a08cd955aea93d4b781b566b07ceb6'] = 'هذا الخيار الأمثل الصور الجديدة للمنتجات عند تحميله، ولكن الخاصة بك تحميل يستغرق مزيدا من الوقت. يجب تعطيل الوحدة النمطية للعلامة المائية. هذا الخيار لا يعمل دائماً، ولكن يمكنك تجديد الصور للمنتجات';
$_MODULE['<{prestaspeed}prestashop>prestaspeed_470baec6860f62cc94096f5c19da4920'] = 'تحسين جميع الصور:';
$_MODULE['<{prestaspeed}prestashop>prestaspeed_98d0fd819c1bc600f4765a02e60bef16'] = 'إذا قمت بتمكين هذا الخيار، ضغط الوحدة النمطية المحددة كل الصور مع خدمة Smushit. يمكن أن يستغرق هذا الوقت تبعاً للمبلغ الخاص بك من الصور. يجب أن تكون جميع بروسيسيد diles نفس مجموع الملفات. إذا كنت لا تحصل على نفس الرقم، كرر العملية حتى تحصل عليه.';
$_MODULE['<{prestaspeed}prestashop>prestaspeed_685f24eb6e60c099123acea8ecc4b505'] = 'نوع من الصور';
$_MODULE['<{prestaspeed}prestashop>prestaspeed_319ecfbe9dfdc6154e92d6f07673cb94'] = 'حدد نوع الصور الأمثل. خيار الوحدات النمطية/مواضيع تحسين جميع صور المواضيع والوحدات النمطية للحصول على أداء أفضل';
$_MODULE['<{prestaspeed}prestashop>prestaspeed_44ae0bdc753bee5158f6c770dc005c64'] = 'مجموع الصور الأمثل في دفعة';
