$_MODULE['<{prestaspeed}prestashop>prestaspeed_c34c8b67ea0e938264b2652feea1a42f'] = 'تمكين أمثلية htaccess أباتشي. يعمل هذا الخيار فقط إذا كان الملقم عليك ملف.htaccess التي تم إنشاؤها. إذا قمت بتمكين هذا الخيار، والموقع لا يعمل (لا تدعم بعض خوادم أمثل جميع)، ببساطة حذف ملف htaccess في الدليل الجذر الخاص بك وقم بإعادة تسمية في.htaccessps إلى.htaccess استعادة الملف الأصلي الخاص بك';
